import mongoose from "mongoose";

const userSchema=new mongoose.Schema({
name:{
        type:String,
        required:true,
    },
    email:{
        type:String,
        required:true,
        unique:true
    },
    password:{
        type:String,
        required:true,
    },
    image:{
        type:String,
        default:"data:image/png;base64,",
    },
   
    address:{
        type:Object,
        default:{line1:'',line2:''}
    },
    gender:{
        type:String,
        default:"not selected",
    },
    dob:{
        type:String,
        default:"not selected",
    },
    phone:{
        type:Number,
        default:"0000000000",
    },
    lastName:{
        type:String,
        
    },
    state:{
        type:String,
        
    },
    zipCode:{
        type:Number,
        
    },
    country:{
        type:String,
        
    },
    
})

const userModel= mongoose.models.user || mongoose.model('user',userSchema)

export default userModel